import React from 'react';
import './App.css';
import ToDoList from './containers/ToDoList'
import AddTodo from './containers/AddTodo'
import { Provider } from 'react-redux'

function App() {
  return (
    <div className="App">
      <h1>To do List</h1>
      <AddTodo />
      <ToDoList />
    </div>
  );
}

export default App;
